  input: TEXT,F3XA,,"Pursuant to Commission guidance issued in Advisory op 1992-33
    Democratic Victory 2004 (The 'Committee') transferred $165,340.39 from its federal
    account to its non-federal on September 30, 2004.This amount represented the federal
    share of the non-federal in-kinds it had received. The Committee completed the
    transfer as soon as it had collected information suffiecient for it to calculate
    the federal share in good faith. Due to the unique nature of the fundraising event
    with which these in-kinds were associated, the Committee was unable to calculate
    the federal share of the in-kinds in advance of or contemporaneous with the event.
    The non-federal in-kinds were almost exclusively pieces of art donated to the
    Committee to be shown at the event.The Committee received an unexpectedly large
    number of these pieces of art which are inherently difficult to value and much
    of the art was received shortly before the event. Therefore, despite its best
    efforts, the Committee was unable to collect much of the valuation information
    about the art until after the event. It continued to collect the information until
    the end of the 3rd quarter when it made and reported the transfer. The Committee
    contimues to review its records in an effort to respond more fully to the Commission's
    inquiry in this matter. The Committee expects to submit a more detailed response
    by the end of January."
